    //     <h3>Code the Dream</h3>
    //     <span className="f5 db lh-copy measure mb2">
    //       I passed the bootcamp test for Code The Dream and I was admitted into the advanced High Noon program where we learn Full-Stack development.
    //     </span>
    //     <p className="i">In progress</p>
    //   </li>
    //   <li className="pa3 pa4-ns bb b--black-10">
    //     <h2>Computer Software Engineering</h2>
    //     <h3>Code Tenderloin</h3>
    //     <span className="f5 db lh-copy measure mb2">
    //       Completed Code Tenderloin’s Job Readiness Program, Code Ramp program and the advanced Code Ramp ++ programs. 
    //     </span>
    //     <p className="i">Class of 2020</p>
    //   </li>
    //   <li className="pa3 pa4-ns bb b--black-10">
    //     <h2>Industrial Engineering</h2>
    //     <h3>Latin American Autonomous University</h3>
    //     <span className="f5 db lh-copy measure mb2">
    //       Industrial Engineer with a minor in Logistics.
    //     </span>
    //     <span className="f5 db lh-copy measure">
    //       Active member of the "Ingeco" research group, participating in national and international meetings in Medellín, Cartagena and Bucaramanga, on the impact of engineering on national development.
    //     </span>
    //     <p className="i">Class of 2015</p>
    //   </li>
    // </ul>


    <section className="mw7 center">
      <h2 className="athelas ph3 ph0-l">News</h2>
      <article className="pv4 bt bb b--black-10 ph3 ph0-l">
        <div className="flex flex-column flex-row-ns">
          <div className="w-100 w-60-ns pr3-ns order-2 order-1-ns">
            <h1 className="f3 athelas mt0 lh-title">Computer Software Engineering</h1>
            <h3 className="athelas">Code the Dream</h3>

            <p className="f5 f4-l lh-copy athelas">
              The tech giant says it is ready to begin planning a quantum
              computer, a powerful cpu machine that relies on subatomic particles instead
              of transistors.
            </p>
          </div>
          <div className="pl3-ns order-1 order-2-ns mb4 mb0-ns w-100 w-40-ns">
            <img src="http://mrmrs.github.io/photos/cpu.jpg" className="db" alt="Photo of a dimly lit room with a computer interface terminal." />
          </div>
        </div>
        <p className="f6 lh-copy gray mv0">By <span className="ttu">Robin Darnell</span></p>
        <time className="f6 db gray">Nov. 21, 2016</time>
      </article>
      <article className="pv4 bb b--black-10 ph3 ph0-l">
        <div className="flex flex-column flex-row-ns">
          <div className="w-100 w-60-ns pr3-ns order-2 order-1-ns">
            <h1 className="f3 athelas mt0 lh-title">A whale takes up residence in a large body of water</h1>
            <p className="f5 f4-l lh-copy athelas">
              This giant of a whale says it is ready to begin planning a new
              swim later this afternoon. A powerful mammal that relies on fish and plankton instead
              of hamburgers.
            </p>
          </div>
          <div className="pl3-ns order-1 order-2-ns mb4 mb0-ns w-100 w-40-ns">
            <img src="http://mrmrs.github.io/photos/whale.jpg" className="db" alt="Photo of a whale's tale coming crashing out of the water." />
          </div>
        </div>
        <p className="f6 lh-copy gray mv0">By <span className="ttu">Katherine Grant</span></p>
        <time className="f6 db gray">Nov. 19, 2016</time>
      </article>
      <article className="pv4 bb b--black-10 ph3 ph0-l">
        <div className="flex flex-column flex-row-ns">
          <div className="w-100 w-60-ns pr3-ns order-2 order-1-ns">
            <h1 className="f3 athelas mt0 lh-title">
              ‘We Couldn’t Believe Our Eyes’: A Lost World of Vinyl Is Found
            </h1>
            <p className="f5 f4-l lh-copy athelas">
              Archaeologists have found more than 40 tons of vinyl records,
              some more than a five years old, shedding light on early hipster
              trends.
            </p>
          </div>
          <div className="pl3-ns order-1 order-2-ns mb4 mb0-ns w-100 w-40-ns">
            <img src="http://mrmrs.github.io/photos/warehouse.jpg" className="db" alt="Photo of a warehouse with stacked shelves." />
          </div>
        </div>
        <p className="f6 lh-copy gray mv0">By <span className="ttu">Imelda Clancy</span></p>
        <time className="f6 db gray">Nov. 19, 2016</time>
      </article>
    </section>


  );
}

export default Education;
